import React from 'react';
import "./Slider.css";

const slidesInfo = [
    {
        src: "https://cdn.pixabay.com/photo/2018/02/21/09/15/mosaic-3169814_960_720.jpg",
        alt: "pixel",
        desc: "pixel"
    },

    {
        src: "https://cdn.pixabay.com/photo/2015/11/07/09/14/sunrise-1030592_960_720.jpg",
        alto: "",
        desc: ""
    },

    {
        src: "https://cdn.pixabay.com/photo/2018/04/13/16/13/pixel-3316924_960_720.png",
        alt: "bulbasaur",
        desc: "bulbasaur"
    },
]

const slides = slidesInfo.map(slide => (
    
    <div className="slide-container">
        <img src={slide.src} alt= {slide.alt}/>
        <div className="slide-desc">
            <span>{slide.desc}</span>
        </div>
    </div>   
    
    ))

    export default slides;
